### STEP1 数据读取 ###
class DataInformation:
	def __init__(self,file_dir,data_name,data_type):
		self.file_dir = file_dir
		self.data_name = data_name
		self.data_type = data_type
		return

	def ReadData_Ego(self):
		tempt_nodes_information = {}
		graph_information = {'SUM_Node':0,
							 'SUM_Edge':0,
							 'SUM_Group':0,
							 'Groups':{}
							}
		# edges.txt
		file_name = self.file_dir+self.data_name+'.edges'
		f = open(file_name,'r')
		edge = f.readline()
		while edge != '':
			if edge[0] == '#':
				edge = f.readline()
				continue
			if '\n' == edge[len(edge)-1]:
				edge = edge[:len(edge)-1]
			if '\t' in edge:
				item = edge.split('\t')
			elif ' ' in edge:
				item = edge.split(' ')
			v1 = item[0]
			v2 = item[1]
			graph_information['SUM_Edge'] = graph_information['SUM_Edge'] + 1
			if v1 in tempt_nodes_information.keys():
				if v2 not in tempt_nodes_information[v1][0]:
					tempt_nodes_information[v1][0].append(v2)
			else:
				tempt_nodes_information[v1] = [[self.data_name,v2],[]]
				graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
			if v2 in tempt_nodes_information.keys():
				if v1 not in tempt_nodes_information[v2][0]:
					tempt_nodes_information[v2][0].append(v1)
			else:
				tempt_nodes_information[v2] = [[self.data_name,v1],[]]
				graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
			edge = f.readline()
		graph_information['SUM_Edge'] = graph_information['SUM_Edge'] + graph_information['SUM_Node']
		graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
		allother_nodes = list(tempt_nodes_information.keys())
		tempt_nodes_information[self.data_name] = [allother_nodes,[]]
		f.close()
		print('edges.txt OK \n \t SUM_Edge : '+str(graph_information['SUM_Edge'])+' \n \t SUM_Node : '+str(graph_information['SUM_Node']))
		# attribute.txt
		file_name = self.file_dir+self.data_name+'.egofeat'
		f = open(file_name,'r')
		attribute = f.readline()
		if '\n' == attribute[len(attribute)-1]:
			attribute = attribute[:len(attribute)-1]
		if '\t' in attribute:
			item = attribute.split('\t')
		elif ' ' in attribute:
			item = attribute.split(' ')
		all_attribute_num = len(item)+1
		attribute_list = [0 for i in range(0,all_attribute_num)]
		for i in range(0,len(item)):
			if item[i] == '1':
				tempt_nodes_information[self.data_name][1].append(i+1)
				attribute_list[i+1] = attribute_list[i+1] + 1
		f.close()
		file_name = self.file_dir+self.data_name+'.feat'
		f = open(file_name,'r')
		attribute = f.readline()
		while attribute != '':
			if '\n' == attribute[len(attribute)-1]:
				attribute = attribute[:len(attribute)-1]
			if '\t' in attribute:
				item = attribute.split('\t')
			elif ' ' in attribute:
				item = attribute.split(' ')
			node = item[0]
			for i in range(1,len(item)):
				if item[i] == '1':
					if node in tempt_nodes_information.keys():
						tempt_nodes_information[node][1].append(i)
					attribute_list[i] = attribute_list[i] + 1
			attribute = f.readline()
		f.close()
		for i in range(0,len(attribute_list)):
			attribute_list[i] = attribute_list[i]*1.0/graph_information['SUM_Node']
		print('attribute.txt OK \n \t attribute_list get ')
		# groups.txt
		file_name = self.file_dir+self.data_name+'.circles'
		f = open(file_name,'r')
		groups = f.readline()
		while groups != '':
			graph_information['SUM_Group'] = graph_information['SUM_Group'] + 1
			if '\n' == groups[len(groups)-1]:
				groups = groups[:len(groups)-1]
			if '\t' in groups:
				items = groups.split('\t')
			elif ' ' in groups:
				items = groups.split(' ')
			items.append(self.data_name)
			group_name = items[0]
			graph_information['Groups'][group_name] = [[],[]]
			a_attribute_list = [0 for i in range(0,all_attribute_num)]
			for i in range(1,len(items)):
				node = items[i]
				if node in tempt_nodes_information.keys():
					graph_information['Groups'][group_name][0].append(node)
					for j in tempt_nodes_information[node][1]:
						a_attribute_list[j] = a_attribute_list[j] + 1
			group_noden = len(graph_information['Groups'][group_name][0])
			rank_attribute_list = []
			for i in range(1,all_attribute_num):
				if a_attribute_list[i] != 0:
					a_attribute_list[i] = a_attribute_list[i]*1.0/group_noden-attribute_list[i]
					rank_attribute_list.append([a_attribute_list[i],i])
			rank_attribute_list = sorted(rank_attribute_list,key=lambda x:x[0],reverse=True)
			graph_information['Groups'][group_name][1] = [rank_attribute_list[i][1] for i in range(0,len(rank_attribute_list))]
			groups = f.readline()
		print('Group Information Collection OK\n\n')
		f.close()
		self.graph_information = graph_information
		self.tempt_nodes_information = tempt_nodes_information
		return 

	def ReadData_EgoAll(self):
		tempt_nodes_information = {}
		graph_information = {'SUM_Node':0,
							 'SUM_Edge':0,
							 'SUM_Group':0,
							 'Groups':{}
							}
		name_list = eval(self.data_name)
		# edges.txt
		for i in range(0,len(name_list)):
			ego_name = str(name_list[i])
			file_name = self.file_dir+ego_name+'.edges'
			f = open(file_name,'r')
			edge = f.readline()
			added_node = []
			while edge != '':
				if edge[0] == '#':
					edge = f.readline()
					continue
				if '\n' == edge[len(edge)-1]:
					edge = edge[:len(edge)-1]
				if '\t' in edge:
					item = edge.split('\t')
				elif ' ' in edge:
					item = edge.split(' ')
				v1 = item[0]
				v2 = item[1]
				if v1 == v2:
					edge = f.readline()
					continue
				graph_information['SUM_Edge'] = graph_information['SUM_Edge'] + 1
				if v1 in tempt_nodes_information.keys():
					if v2 not in tempt_nodes_information[v1][0]:
						tempt_nodes_information[v1][0].append(v2)
				else:
					tempt_nodes_information[v1] = [[ego_name,v2],[]]
					graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
					added_node.append(v1)
				if v2 in tempt_nodes_information.keys():
					if v1 not in tempt_nodes_information[v2][0]:
						tempt_nodes_information[v2][0].append(v1)
				else:
					tempt_nodes_information[v2] = [[ego_name,v1],[]]
					graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
					added_node.append(v2)
				edge = f.readline()
			f.close()
			if ego_name not in tempt_nodes_information.keys():
				tempt_nodes_information[ego_name] = [[],[]]
				graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
			for node in added_node:
				if node not in tempt_nodes_information[ego_name][0]:
					graph_information['SUM_Edge'] = graph_information['SUM_Edge'] + 1
					tempt_nodes_information[ego_name][0].append(node)
		print('edges.txt OK \n \t SUM_Edge : '+str(graph_information['SUM_Edge'])+' \n \t SUM_Node : '+str(graph_information['SUM_Node']))
		# featnames.txt
		featname_lists = {}
		max_attributeID = -1
		for i in range(0,len(name_list)):
			ego_name = str(name_list[i])
			featname_lists[ego_name] = []
			file_name = self.file_dir+ego_name+'.featnames'
			f = open(file_name,'r')
			featname = f.readline()
			while featname != '':
				if '\n' == featname[len(featname)-1]:
					featname = featname[:len(featname)-1]
				if '\t' in featname:
					item = featname.split('\t')
				elif ' ' in featname:
					item = featname.split(' ')
				attributeID = int(item[len(item)-1])
				if attributeID > max_attributeID:
					max_attributeID = attributeID
				featname_lists[ego_name].append(attributeID)
				featname = f.readline()
			f.close()
		all_attribute_num = max_attributeID+1
		attribute_list = [0 for i in range(0,all_attribute_num)]
		# attribute.txt
		for i in range(0,len(name_list)):
			ego_name = str(name_list[i])
			file_name = self.file_dir+ego_name+'.egofeat'
			f = open(file_name,'r')
			featname_list = featname_lists[ego_name]
			attribute = f.readline()
			if '\n' == attribute[len(attribute)-1]:
				attribute = attribute[:len(attribute)-1]
			if '\t' in attribute:
				item = attribute.split('\t')
			elif ' ' in attribute:
				item = attribute.split(' ')
			for j in range(0,len(item)):
				if item[j] == '1':
					tempt_nodes_information[ego_name][1].append(featname_list[j])
					attribute_list[featname_list[j]] = attribute_list[featname_list[j]] + 1
			f.close()
		for i in range(0,len(name_list)):
			ego_name = str(name_list[i])
			file_name = self.file_dir+ego_name+'.feat'
			f = open(file_name,'r')
			featname_list = featname_lists[ego_name]
			attribute = f.readline()
			while attribute != '':
				if '\n' == attribute[len(attribute)-1]:
					attribute = attribute[:len(attribute)-1]
				if '\t' in attribute:
					item = attribute.split('\t')
				elif ' ' in attribute:
					item = attribute.split(' ')
				node = item[0]
				for j in range(1,len(item)):
					if item[j] == '1':
						if node in tempt_nodes_information.keys():
							tempt_nodes_information[node][1].append(featname_list[j-1])
						attribute_list[featname_list[j-1]] = attribute_list[featname_list[j-1]] + 1
				attribute = f.readline()
			f.close()
		for i in range(0,len(attribute_list)):
			attribute_list[i] = attribute_list[i]*1.0/graph_information['SUM_Node']
		print('attribute.txt OK \n \t attribute_list get ')
		# groups.txt
		groupID = 0
		for i in range(0,len(name_list)):
			ego_name = str(name_list[i])
			file_name = self.file_dir+ego_name+'.circles'
			f = open(file_name,'r')
			groups = f.readline()
			while groups != '':
				groupID = groupID + 1
				graph_information['SUM_Group'] = graph_information['SUM_Group'] + 1
				if '\n' == groups[len(groups)-1]:
					groups = groups[:len(groups)-1]
				if '\t' in groups:
					items = groups.split('\t')
				elif ' ' in groups:
					items = groups.split(' ')
				items.append(ego_name)
				group_name = str(groupID)
				graph_information['Groups'][group_name] = [[],[]]
				a_attribute_list = [0 for j in range(0,all_attribute_num)]
				for j in range(1,len(items)):
					node = items[j]
					if node in tempt_nodes_information.keys():
						graph_information['Groups'][group_name][0].append(node)
						for k in tempt_nodes_information[node][1]:
							a_attribute_list[k] = a_attribute_list[k] + 1
				group_noden = len(graph_information['Groups'][group_name][0])
				rank_attribute_list = []
				for j in range(0,all_attribute_num):
					if a_attribute_list[j] != 0:
						a_attribute_list[j] = a_attribute_list[j]*1.0/group_noden-attribute_list[j]
						rank_attribute_list.append([a_attribute_list[j],j])
				rank_attribute_list = sorted(rank_attribute_list,key=lambda x:x[0],reverse=True)
				graph_information['Groups'][group_name][1] = [rank_attribute_list[i][1] for i in range(0,len(rank_attribute_list))]
				groups = f.readline()
			f.close()
		print('Group Information Collection OK '+str(len(graph_information['Groups']))+'\n\n')
		self.graph_information = graph_information
		self.tempt_nodes_information = tempt_nodes_information
		return 

	def ReadData_Attribute(self):
		edge_name = self.data_name[0]
		attributegroup_name = self.data_name[1]
		tempt_nodes_information = {}
		graph_information = {'SUM_Node':0,
							 'SUM_Edge':0,
							 'SUM_Group':0,
							 'Groups':{}
							}
		# edges.txt
		file_name = self.file_dir+edge_name
		f = open(file_name,'r')
		edge = f.readline()
		while edge != '':
			if edge[0] == '#':
				edge = f.readline()
				continue
			if '\n' == edge[len(edge)-1]:
				edge = edge[:len(edge)-1]
			if '\t' in edge:
				item = edge.split('\t')
			elif ' ' in edge:
				item = edge.split(' ')
			v1 = item[0]
			v2 = item[1]
			if v1 == v2:
				edge = f.readline()
				continue
			graph_information['SUM_Edge'] = graph_information['SUM_Edge'] + 1
			if v1 in tempt_nodes_information.keys():
				if v2 not in tempt_nodes_information[v1][0]:
					tempt_nodes_information[v1][0].append(v2)
			else:
				tempt_nodes_information[v1] = [[v2],[]]
				graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
			if v2 in tempt_nodes_information.keys():
				if v1 not in tempt_nodes_information[v2][0]:
					tempt_nodes_information[v2][0].append(v1)
			else:
				tempt_nodes_information[v2] = [[v1],[]]
				graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
			edge = f.readline()
		f.close()
		print('edges.txt OK \n \t SUM_Edge : '+str(graph_information['SUM_Edge'])+' \n \t SUM_Node : '+str(graph_information['SUM_Node']))
		#print('http://www.cs.utexas.edu/users/yangyang/cs352' in tempt_nodes_information.keys())
		# attribute.txt
		# group.txt initial
		file_name = self.file_dir+attributegroup_name
		f = open(file_name,'r')
		attribute = f.readline()
		if '\n' == attribute[len(attribute)-1]:
			attribute_ = attribute[:len(attribute)-1]
		if '\t' in attribute:
			item = attribute_.split('\t')
		elif ' ' in attribute:
			item = attribute_.split(' ')
		all_attribute_num = len(item)-1
		attribute_list = [0 for i in range(0,all_attribute_num)]
		GroupsTempt = {}
		while attribute != '':
			if '\n' == attribute[len(attribute)-1]:
				attribute = attribute[:len(attribute)-1]
			if '\t' in attribute:
				item = attribute.split('\t')
			elif ' ' in attribute:
				item = attribute.split(' ')
			node = item[0]
			group_name = item[len(item)-1]
			for i in range(1,all_attribute_num):
				if item[i] == '1':
					if node in tempt_nodes_information.keys():
						tempt_nodes_information[node][1].append(i)
					attribute_list[i] = attribute_list[i] + 1
			if node in tempt_nodes_information.keys():
				if group_name not in graph_information['Groups'].keys():
					graph_information['Groups'][group_name] = [[],[]]
					GroupsTempt[group_name] = [0 for i in range(0,all_attribute_num)]
				graph_information['Groups'][group_name][0].append(node)
				for i in tempt_nodes_information[node][1]:
					GroupsTempt[group_name][i] = GroupsTempt[group_name][i] + 1
			attribute = f.readline()
		f.close()
		for i in range(0,len(attribute_list)):
			attribute_list[i] = attribute_list[i]*1.0/graph_information['SUM_Node']
		print('attribute.txt OK \n \t attribute_list get ')
		# groups.txt most frequent
		for group_name in graph_information['Groups'].keys():
			group_noden = len(graph_information['Groups'][group_name][0])
			rank_attribute_list = []
			for i in range(1,all_attribute_num):
				if GroupsTempt[group_name][i] != 0:
					GroupsTempt[group_name][i] = GroupsTempt[group_name][i]*1.0/group_noden-attribute_list[i]
					rank_attribute_list.append([GroupsTempt[group_name][i],i])
			rank_attribute_list = sorted(rank_attribute_list,key=lambda x:x[0],reverse=True)
			graph_information['Groups'][group_name][1] = [rank_attribute_list[i][1] for i in range(0,len(rank_attribute_list))]
		f.close()
		graph_information['SUM_Group'] = len(graph_information['Groups'])
		print('Group Information Collection OK\n\n')
		self.graph_information = graph_information
		self.tempt_nodes_information = tempt_nodes_information
		return 

