	def ReadData_Special(self):
		name = self.data_name[0]
		class_list = self.data_name[1] 
		tempt_nodes_information = {}
		graph_information = {'SUM_Node':0,
							 'SUM_Edge':0,
							 'SUM_Group':0,
							 'Groups':{}
							}
		# edges.txt
		file_name = self.file_dir+name+".edges"
		f = open(file_name,'r')
		edge = f.readline()
		while edge != '':
			if edge[0] == '#':
				edge = f.readline()
				continue
			if '\n' == edge[len(edge)-1]:
				edge = edge[:len(edge)-1]
			if '\t' in edge:
				item = edge.split('\t')
			elif ' ' in edge:
				item = edge.split(' ')
			v1 = item[0]
			v2 = item[1]
			if v1 == v2:
				edge = f.readline()
				continue
			graph_information['SUM_Edge'] = graph_information['SUM_Edge'] + 1
			if v1 in tempt_nodes_information.keys():
				if v2 not in tempt_nodes_information[v1][0]:
					tempt_nodes_information[v1][0].append(v2)
			else:
				tempt_nodes_information[v1] = [[v2],[]]
				graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
			if v2 in tempt_nodes_information.keys():
				if v1 not in tempt_nodes_information[v2][0]:
					tempt_nodes_information[v2][0].append(v1)
			else:
				tempt_nodes_information[v2] = [[v1],[]]
				graph_information['SUM_Node'] = graph_information['SUM_Node'] + 1
			edge = f.readline()
		f.close()
		print('edges.txt OK \n \t SUM_Edge : '+str(graph_information['SUM_Edge'])+' \n \t SUM_Node : '+str(graph_information['SUM_Node']))
		# attribute.txt
		# group.txt initial
		file_name = self.file_dir+name+"_"+class_list[0]+".nodes"
		f = open(file_name,'r')
		attribute = f.readline()
		if '\n' == attribute[len(attribute)-1]:
			attribute_ = attribute[:len(attribute)-1]
		if '\t' in attribute:
			item = attribute_.split('\t')
		elif ' ' in attribute:
			item = attribute_.split(' ')
		all_attribute_num = len(item)-1
		attribute_list = [0 for i in range(0,all_attribute_num)]
		f.close()
		GroupsTempt = {}
		for i in range(0,len(class_list)):
			class_name = class_list[i].capitalize()
			file_name = self.file_dir+name+"_"+class_name+".nodes"
			f = open(file_name,'r')
			attribute = f.readline()
			while attribute != '':
				if '\n' == attribute[len(attribute)-1]:
					attribute = attribute[:len(attribute)-1]
				if '\t' in attribute:
					item = attribute.split('\t')
				elif ' ' in attribute:
					item = attribute.split(' ')
				node = item[0]
				group_name = item[len(item)-1]
				if node in tempt_nodes_information.keys():
					if tempt_nodes_information[node][1] == []:
						for j in range(1,all_attribute_num):
							if item[j] == '1':
								tempt_nodes_information[node][1].append(j)
								attribute_list[j] = attribute_list[j] + 1
					if group_name in class_list:
						if group_name not in graph_information['Groups'].keys():
							graph_information['Groups'][group_name] = [[],[]]
							GroupsTempt[group_name] = [0 for j in range(0,all_attribute_num)]
						graph_information['Groups'][group_name][0].append(node)
						for j in tempt_nodes_information[node][1]:
							GroupsTempt[group_name][j] = GroupsTempt[group_name][j] + 1
				attribute = f.readline()
			f.close()
		for i in range(0,len(attribute_list)):
			attribute_list[i] = attribute_list[i]*1.0/graph_information['SUM_Node']
		print('attribute.txt OK \n \t attribute_list get ')
		# groups.txt most frequent
		for group_name in graph_information['Groups'].keys():
			group_noden = len(graph_information['Groups'][group_name][0])
			rank_attribute_list = []
			for i in range(1,all_attribute_num):
				if GroupsTempt[group_name][i] != 0:
					GroupsTempt[group_name][i] = GroupsTempt[group_name][i]*1.0/group_noden-attribute_list[i]
					rank_attribute_list.append([GroupsTempt[group_name][i],i])
			rank_attribute_list = sorted(rank_attribute_list,key=lambda x:x[0],reverse=True)
			graph_information['Groups'][group_name][1] = [rank_attribute_list[i][1] for i in range(0,len(rank_attribute_list))]
		f.close()
		graph_information['SUM_Group'] = len(graph_information['Groups'])
		print('Group Information Collection OK\n\n')
		self.graph_information = graph_information
		self.tempt_nodes_information = tempt_nodes_information
		return 

	def main(self):
		if self.data_type == 'Ego':
			self.ReadData_Ego()
		elif self.data_type == 'EgoAll':
			self.ReadData_EgoAll()
		elif self.data_type == 'Attribute':
			self.ReadData_Attribute()
		elif self.data_type == 'SNAP':
			self.ReadData_SNAP()
		elif self.data_type == 'SMALL':
			self.ReadData_SMALL()
		elif self.data_type == 'Others':
			self.ReadData_Others()
		elif self.data_type == 'Special':
			self.ReadData_Special()
		return [self.graph_information,self.tempt_nodes_information]

	def SampleList(self,QVn,QAn):
		ExperimentalDataList = []
		for group_name in self.graph_information['Groups'].keys():
			GMembers = self.graph_information['Groups'][group_name][0]
			if len(GMembers)>QVn and len(GMembers)>=3:
				GAttribute = self.graph_information['Groups'][group_name][1]
				sumsample = 20
				for i in range(0,sumsample):
					if QVn == -1:
						maxnumber = 16
						if maxnumber > len(GMembers):
							maxnumber = len(GMembers)
						number = random.randint(1,maxnumber)
						QVlist = random.sample(GMembers,number)
					else:
						QVlist = random.sample(GMembers,QVn)
					if QAn == -1:
						maxnumber = 5
						if maxnumber > len(GAttribute):
							maxnumber = len(GAttribute)
						QAn = random.randint(1,maxnumber)
						QAlist = list(GAttribute[:QAn])
					else:
						QAlist = list(GAttribute[:QAn])
				ExperimentalDataList.append([group_name,QVlist,QAlist])
		return ExperimentalDataList
